import React from "react";

const Button = ({ children, className }) => {
  return (
    <div className={`px-4 py-2 bg-green-600 rounded-lg hover:bg-green-500 hover:scale-110 ${className}`}>
      {children}
    </div>
  );
};

export default Button;
